import React from 'react'
import { connect } from 'react-redux';
import { fetchCities } from "../redux/actions/cityAction"

class MYtinerary extends React.Component {

    componentDidMount() {
        this.props.getCities()
    }
    render() {
        const citiesList = cities.length ? (cities.map(city => {
            return (
                <div key={city._id}>
                    <div>{city.name}</div>
                    <div>{city.country}</div>
                    <img src={city.images} alt="cityimages"></img>

                </div>
            )
        })) : (
                <div>nothing</div>
            )
        console.log(this.props)
        return (
            <div >
                <p>My Cities</p>
            </div>
        )
    }
}


const mapStateToProps = (state) => {
    return {
        cities: state.cities

    }
}
const mapDispatchToProps = (dispatch) => {
    return {
        getCities: () => dispatch(fetchCities())
    }
}
export default connect(mapStateToProps, mapDispatchToProps)(MYtinerary);
